    import './fonts/MSignUp.css';

function SignUp() {
  return (
    <div class="background">
    <div class="colorspace">
      <p class="heading">S I G N &nbsp; U P</p>
      <div class="shopimg"/>
    </div>
    <div class="whitespace">
      <p class="loginheading">Sign Up</p>
      <input class="input" placeholder='First Name'></input>
      <input class="input" placeholder='Last Name'></input>
      <input class="input" placeholder='Phone Number'></input>
      <input class="input" placeholder='Email'></input>
      <input class="input" placeholder='Password'></input>
      <input class="input" placeholder='Address'></input>
      <button class="nstep"        
      onClick={(e) => {
          window.location.href = "/signupc";
        }}>Next Step</button>
      <div class="btext">
        <p class="btexta">Already have an account?</p>
        <button class="btextb" 
        onClick={(e) => {
          window.location.href = "/signin";
        }}>Login</button>
      </div>
    </div>
    </div>
  )
}
export default SignUp;
